const RT60 = (volume, surfaceAbsorbtion) => {
    return (0.161 * volume) / (surfaceAbsorbtion)
}


const SurfaceAbsorption = (surfaces) => {
    let A = 0;
    surfaces.forEach(element => {
        A += (element[0] * element[1])
    });
    return A;
}

console.log(RT60(18, 9, 0.14));
